import React from "react";
import "../style/SearchBar.css";

export default function Searchbar({searched}){
    return(
        <div className="SearchBarContainerForm">
            <input type='text' className="SearchBarContent" placeholder={searched}/>
            <button className="SearchBarButton"></button>
        </div>
    )
}
